import React from "react";
import {Typography} from "@material-ui/core";
import {useQuery} from "@apollo/client";
import {text} from './queries'

export const Home = () => {
    const {loading, error, data} = useQuery(text);
    console.log(data)
    return (
        <div>
            <Typography>qwe</Typography>
        </div>
    )
}
